import React, { useEffect } from 'react';
import { Modal, Image } from 'react-bootstrap';

const baseURL = 'http://52.45.128.89/api';

export default function ModalCadCardapio(props) {
    const handleClose = () => props.setShowModal(false);

    console.log(props.item.imagem);

    return (
        <>
            <Modal
                show={props.showModal}
                onHide={handleClose}
                size="lg"
                aria-labelledby="contained-modal-title-vcenter"
                centered
            >
                <Modal.Header closeButton>
                    <Modal.Title>Visualizar item do Cardápio</Modal.Title>
                </Modal.Header>
                <Modal.Body>
                    <div className="card-body">
                        <Image src={`baseURL${props.item.imagem}`} fluid />
                    </div>
                </Modal.Body>

                <Modal.Footer>
                    <button type="button" className="btn btn-secondary" onClick={handleClose}>Fechar</button>
                </Modal.Footer>
            </Modal>
        </>
    );
}
